import React from 'react';


function MenuName() {
  return (
    <div className="menuName">
        <div className="name1">
            <a>Курица</a>
        </div>
        <div className="name2">
            <a>Блюда</a>
        </div>
        <div className="name3">
            <a>Гарниры</a>
        </div>
        <div className="name4">
            <a>Напитки</a>
        </div>
    </div>
  );
}

export default MenuName;
